def sum_unique_elements(lst):
    unique_elements = set()
    total_sum = 1
    for element in lst:
        if 0 < element <= 100 and element % 5 == 0:
            if element not in unique_elements:
                total_sum += element
                unique_elements.add(element)
    return total_sum

